import React, { useState } from "react";
import "bootstrap/dist/css/bootstrap.css";

import { Nav, Navbar, Container } from "react-bootstrap";

function Navigation() {
  const [open, isOpen] = useState(true);

  return (
    <div
      style={{
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        backgroundColor: "#b39cd0",
        fontFamily: "Zen Tokyo Zoo",
      }}
    >
      <Navbar collapseOnSelect expand="lg" bg="transparent">
        <Container>
          <Navbar.Toggle />
          <Navbar.Collapse>
            <Nav
              style={{
                display: "flex",
                gap: "15px",
              }}
              className="fs-3"
            >
              <Nav.Link style={{ color: "#fff" }}>Home</Nav.Link>
              <Nav.Link style={{ color: "#fff" }}>About</Nav.Link>
              <Nav.Link style={{ color: "#fff" }}>Contact</Nav.Link>
              <Nav.Link style={{ color: "#fff" }}>Sign In</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </div>
  );
}

export default Navigation;
